import React, { useState } from 'react';
import { Box } from '@mui/material';
import SwipeCard from '../components/SwipeCard';

// Mock data
const mockProfiles = [
  {
    _id: 1,
    profile: {
      firstName: "Sarah",
      age: 26,
      location: {
        city: "New York City"
      },
      photos: [
        "https://images.unsplash.com/photo-1494790108377-be9c29b29330",
        "https://images.unsplash.com/photo-1524504388940-b1c1722653e1",
        "https://images.unsplash.com/photo-1517841905240-472988babdf9",
      ],
      bio: "Adventure seeker and coffee enthusiast. Love exploring new places and trying different cuisines.",
      interests: ["Travel", "Photography", "Cooking", "Hiking", "Coffee"],
      occupation: "UX Designer",
      education: "Parsons School of Design"
    }
  },
  {
    _id: 2,
    profile: {
      firstName: "Michael",
      age: 28,
      location: {
        city: "San Francisco"
      },
      photos: [
        "https://images.unsplash.com/photo-1500648767791-00dcc994a43e",
        "https://images.unsplash.com/photo-1472099645785-5658abf4ff4e",
        "https://images.unsplash.com/photo-1519085360753-af0119f7cbe7",
      ],
      bio: "Tech enthusiast and amateur chef. When I'm not coding, you'll find me experimenting in the kitchen or hiking trails.",
      interests: ["Technology", "Cooking", "Hiking", "Gaming", "Music"],
      occupation: "Software Engineer",
      education: "Stanford University"
    }
  }
];

const Discovery = () => {
  const [currentProfileIndex, setCurrentProfileIndex] = useState(0);

  const handleLike = () => {
    console.log(`Liked profile:`, mockProfiles[currentProfileIndex]);
    if (currentProfileIndex < mockProfiles.length - 1) {
      setCurrentProfileIndex(prev => prev + 1);
    }
  };

  const handlePass = () => {
    console.log(`Passed profile:`, mockProfiles[currentProfileIndex]);
    if (currentProfileIndex < mockProfiles.length - 1) {
      setCurrentProfileIndex(prev => prev + 1);
    }
  };

  const handleSuperLike = () => {
    console.log(`Super liked profile:`, mockProfiles[currentProfileIndex]);
    if (currentProfileIndex < mockProfiles.length - 1) {
      setCurrentProfileIndex(prev => prev + 1);
    }
  };

  return (
    <Box
      sx={{
        height: '100vh',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        padding: '20px',
        backgroundColor: '#f5f5f5',
      }}
    >
      <SwipeCard
        user={currentProfileIndex < mockProfiles.length ? mockProfiles[currentProfileIndex] : null}
        onLike={handleLike}
        onPass={handlePass}
        onSuperLike={handleSuperLike}
      />
    </Box>
  );
};

export default Discovery;
